def KL_divergence(mu, logsigma):
    return -0.5 * T.mean(T.sum(1 + 2 * logsigma - T.sqr(mu) - T.exp(2 * logsigma), axis=1))

def log_likelihood(x, mu, logsigma):
    return -T.mean(T.sum((np.float32(0.5 * np.log(2. * np.pi)) + logsigma) +\
                  0.5 * T.sqr(x - mu) / T.exp(2. * logsigma), axis=1))
